{
  "$id": "http://example.com/example.json",
  "type": "object",
  "properties": {
    "data": {
      "$id": "/properties/data",
      "type": "object",
      "properties": {
        "profile": {
          "$id": "/properties/data/properties/profile",
          "type": "object",
          "properties": {
            "profileId": {
              "$id": "/properties/data/properties/profile/properties/profileId",
              "type": "string",
              "title": "The Profileid Schema ",
              "default": "",
              "examples": [
                "5b4f3c60db9ed457ff3526fc"
              ]
            },
            "profileName": {
              "$id": "/properties/data/properties/profile/properties/profileName",
              "type": "string",
              "title": "The Profilename Schema ",
              "default": "",
              "examples": [
                "lavanya"
              ]
            },
            "profileDesc": {
              "$id": "/properties/data/properties/profile/properties/profileDesc",
              "type": "string",
              "title": "The Profiledesc Schema ",
              "default": "",
              "examples": [
                "lavanya"
              ]
            },
            "isSystemProfile": {
              "$id": "/properties/data/properties/profile/properties/isSystemProfile",
              "type": "boolean",
              "title": "The Issystemprofile Schema ",
              "default": false,
              "examples": [
                false
              ]
            },
            "isDefaultProfile": {
              "$id": "/properties/data/properties/profile/properties/isDefaultProfile",
              "type": "boolean",
              "title": "The Isdefaultprofile Schema ",
              "default": false,
              "examples": [
                false
              ]
            },
            "isPublicProfile": {
              "$id": "/properties/data/properties/profile/properties/isPublicProfile",
              "type": "boolean",
              "title": "The Ispublicprofile Schema ",
              "default": false,
              "examples": [
                false
              ]
            },
            "profileKeys": {
              "$id": "/properties/data/properties/profile/properties/profileKeys",
              "type": "array",
              "items": {
                "$id": "/properties/data/properties/profile/properties/profileKeys/items",
                "type": "object",
                "properties": {
                  "category": {
                    "$id": "/properties/data/properties/profile/properties/profileKeys/items/properties/category",
                    "type": "string",
                    "title": "The Category Schema ",
                    "default": "",
                    "examples": [
                      "test"
                    ]
                  },
                  "label": {
                    "$id": "/properties/data/properties/profile/properties/profileKeys/items/properties/label",
                    "type": "string",
                    "title": "The Label Schema ",
                    "default": "",
                    "examples": [
                      "new"
                    ]
                  }
                },
                "required": [
                  "category",
                  "label"
                ]
              }
            }
          },
          "required": [
            "profileId",
            "profileName",
            "profileDesc",
            "isSystemProfile",
            "isDefaultProfile",
            "isPublicProfile",
            "profileKeys"
          ]
        }
      },
      "required": [
        "profile"
      ]
    },
    "message": {
      "$id": "/properties/message",
      "type": "string",
      "title": "The Message Schema ",
      "default": "",
      "examples": [
        "User privacy profile created successfully."
      ]
    }
  },
  "required": [
    "data",
    "message"
  ]
}
